import React, { Component, Fragment } from "react";
import Card from "react-bootstrap/Card";
// import Card from "react-bootstrap/Card";
import Cardgroup from "react-bootstrap/CardGroup";

class Interest extends Component {
  render() {
    return (
      <Fragment>
        <h1 className="text-center mt-4 mb-4">Hobbies</h1>
        <div className="container">
          <div class="row">
            <Cardgroup>
              <Card className="col-sm">
                <Card.Img
                  variant="top"
                  style={{ width: "10rem", display: "flex" }}
                  src="https://img.freepik.com/free-vector/vintage-cricket-elements-collection_1284-37952.jpg?w=150"
                />
                <Card.Body>
                  <Card.Title className="text-center">Cricket</Card.Title>
                  <Card.Text>
                    Playing cricket is love but playing with childhood friends
                    is like a decade cross
                  </Card.Text>
                </Card.Body>
              </Card>

              <Card className="col-sm ">
                <Card.Img
                  variant="top"
                  style={{ width: "18rem" }}
                  src="data:image/jpeg;base64,"
                />
                <Card.Body>
                  <Card.Title className="text-center">Cricket</Card.Title>
                  <Card.Text>
                    Playing cricket is love but playing with childhood friends
                    is like a decade cross.
                  </Card.Text>
                </Card.Body>
              </Card>
              <Card className="col-sm">
                <Card.Img
                  variant="top"
                  style={{ width: "20rem" }}
                  src="data:image/jpeg;base64,"
                />
                <Card.Body>
                  <Card.Title className="text-center">Online Games</Card.Title>
                  <Card.Text>
                    Due to Corona-virus's lockdown we all get attached with
                    Online mobile games.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Cardgroup>
          </div>
        </div>
        <h1 className="text-center">Learned || Learning</h1>
        <div className="container">
          <div class="row">
            <Card className="col-sm" style={{ width: "18rem" }}>
              <Card.Img
                variant="top"
                src="data:image/jpeg;base64,"
              />
              <Card.Body>
                <Card.Title className="text-center">Web Development</Card.Title>
                <Card.Text>
                  Web development is consist of front-end and back-end with
                  DataBase.
                </Card.Text>
              </Card.Body>
            </Card>
            <Card className="col-sm" style={{ width: "18rem" }}>
              <Card.Img
                variant="top"
                src="data:image/jpeg;base64,"
              />
              <Card.Body>
                <Card.Title className="text-center">Java Developer</Card.Title>
                <Card.Text>
                  I love to code in Java where as big as confusion.
                </Card.Text>
              </Card.Body>
            </Card>
            <Card
              className="col-sm"
              style={{ width: "18rem", height: "10rem" }}
            >
              <Card.Img
                variant="top"
                src="https://res.cloudinary.com/practicaldev/image/fetch/s--aBMd6Vb7--/c_imagga_scale,f_auto,fl_progressive,h_900,q_auto,w_1600/https://dev-to-uploads.s3.amazonaws.com/i/iedkaocqcuchfrojmfeb.png"
              />
              <Card.Body>
                <Card.Title className="text-center">
                  Python Developer
                </Card.Title>
                <Card.Text>Python is easy and comfortable.</Card.Text>
              </Card.Body>
            </Card>
          </div>
        </div>
      </Fragment>
    );
  }
}

export default Interest;
